// GLOBAL VARIABLES GROUP
// intercept shortcuts flags
var intercept_F3_keypress = false;
var intercept_Ctrl_F_keypress = false;
// search form minimal style flag
var fast_search_minimal_style = false;
// search form right position flag
var fast_search_right_position = false;

(function () {
    chrome.storage.sync.get({
        selection_color_bg: "selection_color_bg",
        selection_color_text: "selection_color_text",
        current_found_bg: "current_found_bg",
        current_found_text: "current_found_text",
        choosen_theme_name: "choosen_theme_name",
        intercept_F3_keypress: "intercept_F3_keypress",
        intercept_Ctrl_F_keypress: "intercept_Ctrl_F_keypress",
        fast_search_minimal_style: "fast_search_minimal_style",
        fast_search_right_position: "fast_search_right_position"


    }, function(items) {
        var selection_color_bg = items.selection_color_bg;
        var selection_color_text = items.selection_color_text;
        var current_found_bg = items.current_found_bg;
        var current_found_text = items.current_found_text;
        var choosen_theme_name = items.choosen_theme_name;
        intercept_F3_keypress = items.intercept_F3_keypress;
        intercept_Ctrl_F_keypress = items.intercept_Ctrl_F_keypress;
        fast_search_minimal_style = items.fast_search_minimal_style;
        fast_search_right_position = items.fast_search_right_position;

        //first start after install the setttings are empty we should load default settings
        //console.log('fast_search_minimal_style - ',fast_search_minimal_style);
        if( selection_color_bg == 'selection_color_bg')
            selection_color_bg = '#F76AB6';
        if( selection_color_text == 'selection_color_text')
            selection_color_text = '#000';
        if( current_found_bg == 'current_found_bg')
            current_found_bg = '#000';
        if( current_found_text == 'current_found_text')
            current_found_text = '#2CD7FF';
        if( choosen_theme_name == 'choosen_theme_name')
            choosen_theme_name = 'classic';
        if( intercept_F3_keypress == 'intercept_F3_keypress')
            intercept_F3_keypress = false;
        if( intercept_Ctrl_F_keypress == 'intercept_Ctrl_F_keypress')
            intercept_Ctrl_F_keypress = false;
        if( fast_search_minimal_style == 'fast_search_minimal_style')
            fast_search_minimal_style = false;
        if( fast_search_right_position == 'fast_search_right_position')
            fast_search_right_position = false;

        //... and save them to chrome local storage
        chrome.storage.sync.set({
            selection_color_bg: selection_color_bg,
            selection_color_text: selection_color_text,
            current_found_bg: current_found_bg,
            current_found_text: current_found_text,
            choosen_theme_name: choosen_theme_name,
            intercept_F3_keypress: intercept_F3_keypress,
            intercept_Ctrl_F_keypress: intercept_Ctrl_F_keypress,
            fast_search_minimal_style: fast_search_minimal_style,
            fast_search_right_position: fast_search_right_position
        }, function() {
            // Update status to let user know options were saved.
            ////console.log('Default settings are saved to chrome local storage');
        });

        if(fast_search_right_position)
        {
            // main menu goes to the left
            $('.popup2_ewq532_fast-search.ewq532_fast-search').addClass('left_poz');
        }

    });

})();


